import React from 'react'
import Footer from '../Footer';
import Navbar from '../Navbar';
import Contact from '../Contact';

function Contactus() {
    return (
        <>
          <Navbar/>
          <Contact/> 
          <Footer/> 
        </>
    )
}

export default Contact
